CREATE DEFINER=`root`@`localhost` PROCEDURE `celegans_search`(IN varneuron varchar(10))
BEGIN
IF Length(varneuron) > 0 THEN
SELECT tblneuron.Neuron, tblinnexin.Innexin
            FROM
            tblNeuron, tblinnexin, lnkneuron_innexin
            WHERE tblneuron.Neuron_PKID = lnkneuron_innexin.Neuron_PKID
            AND lnkneuron_innexin.Innexin_PKID = tblinnexin.Innexin_PKID
            AND tblneuron.neuron like(concat('%', varneuron, '%'));
            
            SELECT tblneuron.Neuron, tblneuropeptide.Neuropeptide
            FROM tblneuron, tblneuropeptide, lnkneuron_neuropeptide
            WHERE tblneuron.Neuron_PKID = lnkneuron_neuropeptide.Neuron_PKID
            AND tblneuropeptide.Neuropeptide_PKID = lnkneuron_neuropeptide.Neuropeptide_PKID
            AND tblneuron.neuron like(concat('%', varneuron, '%'));
            
            SELECT tblneuron.Neuron, tblneurotransmitter.Neurotransmitter
            FROM tblneuron, tblneurotransmitter, lnkneuron_neurotransmitter
            WHERE tblneuron.Neuron_PKID = lnkneuron_neurotransmitter.Neuron_PKID
            AND tblneurotransmitter.Neurotransmitter_PKID = lnkneuron_neurotransmitter.NeuroTransmitter_PKID
            AND tblneuron.neuron like(concat('%', varneuron, '%'));
            
            SELECT tblneuron.Neuron, tblreceptor.Receptor
            FROM tblneuron, tblreceptor, lnkneuron_receptor
            WHERE tblneuron.Neuron_PKID = lnkneuron_receptor.Neuron_PKID
            AND tblreceptor.Receptor_PKID = lnkneuron_receptor.Receptor_PKID
            AND tblneuron.neuron like(concat('%', varneuron, '%'));

ELSEIF Length(varneuron) = 0 THEN
		SELECT tblneuron.Neuron, tblinnexin.Innexin
            FROM
            tblNeuron, tblinnexin, lnkneuron_innexin
            WHERE tblneuron.Neuron_PKID = lnkneuron_innexin.Neuron_PKID
            AND lnkneuron_innexin.Innexin_PKID = tblinnexin.Innexin_PKID;
            
            SELECT tblneuron.Neuron, tblneuropeptide.Neuropeptide
            FROM tblneuron, tblneuropeptide, lnkneuron_neuropeptide
            WHERE tblneuron.Neuron_PKID = lnkneuron_neuropeptide.Neuron_PKID
            AND tblneuropeptide.Neuropeptide_PKID = lnkneuron_neuropeptide.Neuropeptide_PKID;
            
            SELECT tblneuron.Neuron, tblneurotransmitter.Neurotransmitter
            FROM tblneuron, tblneurotransmitter, lnkneuron_neurotransmitter
            WHERE tblneuron.Neuron_PKID = lnkneuron_neurotransmitter.Neuron_PKID
            AND tblneurotransmitter.Neurotransmitter_PKID = lnkneuron_neurotransmitter.NeuroTransmitter_PKID;
            
            SELECT tblneuron.Neuron, tblreceptor.Receptor
            FROM tblneuron, tblreceptor, lnkneuron_receptor
            WHERE tblneuron.Neuron_PKID = lnkneuron_receptor.Neuron_PKID
            AND tblreceptor.Receptor_PKID = lnkneuron_receptor.Receptor_PKID;

END IF;

END ;;
